			<p><b>Ground charcoal</b> is an item used during <a href=""/w/The_Dig_Site"" title=""The Dig Site"">The Dig Site</a>. It is obtained by grounding normal <a href=""/w/Charcoal"" title=""Charcoal"">charcoal</a> with a <a href=""/w/Pestle_and_mortar"" title=""Pestle and mortar"">pestle and mortar</a>. It has no use, except in <a href=""/w/The_Dig_Site"" title=""The Dig Site"">The Dig Site</a> quest where it is necessary to make <a href=""/w/Chemical_compound"" title=""Chemical compound"">Chemical compound</a> (along with <a href=""/w/Nitroglycerin"" title=""Nitroglycerin"">nitroglycerin</a>, <a href=""/w/Ammonium_nitrate"" title=""Ammonium nitrate"">ammonium nitrate</a> and <a href=""/w/Arcenia_root"" title=""Arcenia root"">arcenia root</a>) to blow up bricks blocking the path below the <a href=""/w/Digsite"" title=""Digsite"">digsite</a>.
			</p>
